pragma solidity >=0.5.0 < 0.9.0;
import "./LabResource.sol";
import "./Ownable.sol";

contract UserManagement is Ownable
{
     
    event UserUpdate(string indexed id, string name, uint contactNo, string designation, string role, string department);
    event UserRoleUpdate(string indexed id, string role); 
    
     /* Storage Variables */    
    LabResource labresource;
    
    constructor(address _address) public {
        labresource = LabResource(_address);
    }
    
    
     /* Create/Update User */

    function updateUser(string memory _facultyid, string memory _name, uint  _contactNo, string memory _role,string memory _designation,string memory _department) public returns(bool)
    {
        require(msg.sender != address(0));
        
        /* Call Storage Contract */
        bool status = labresource.setUser(_facultyid,_name, _contactNo, _role, _designation,_department);
        
         /*call event*/
        emit UserUpdate(_facultyid,_name,_contactNo,_role,_designation,_department);
        emit UserRoleUpdate(_facultyid,_role);
        
        return status;
    }
    
    /* Create/Update User For Admin  */
    function updateUserForAdmin(string memory _facultyid, string memory _name,  uint _contactNo, string memory _role,string memory _designation,string memory _department) public onlyOwner returns(bool)
    {
       // require(_userAddress != address(0));
        
        /* Call Storage Contract */
        bool status = labresource.setUser(_facultyid, _name, _contactNo, _role, _designation, _department);
        
         /*call event*/
        emit UserUpdate(_facultyid,_name,_contactNo,_role,_designation,_department);
        emit UserRoleUpdate(_facultyid,_role);
        
        return status;
    }
    
    /* get User */
    function getUser(string memory _facultyid) public returns(string memory facultyid,string memory name, uint contactNo, string memory role, string memory designation , string memory department){
   // require(_userAddress != address(0));
        
        /*Getting value from struct*/
       (facultyid,name, contactNo, role, designation,department) = labresource.getUser(_facultyid);
       
       return (facultyid,name, contactNo, role,designation,department);
    }
}
